#graphql

fragment VaultFields on Vault {
  debtToken
  debtSymbol
  collateralToken
  collateralSymbol
  vaultId
  leverageTier
  totalApe
  totalValue
  lockedLiquidity
  apeAddress
}

query VaultQuery {
  vaults {
    ...VaultFields
  }
}

